#include <vector>
#include <iostream>
#include <map>
#include <queue>
int jump(std::vector<int> &nums)
{
    int l = 0; 
    int r = 0;
    int jump = 0;
    while (r < nums.size() - 1)
    {
        int furthest = 0;
        for (int i = l; i <= r; i++)
        {
            furthest = std::max(furthest, nums[i] + i);

        }
        l = r + 1;
        r = furthest;
        jump += 1;
    }
    return jump;

}
int jump_exceed(std::vector<int> &nums)
{
    if (nums.size() == 1)
        return 0;
    std::map<int, bool> search_record;
    std::map<int, int> jump_record;
    std::queue<int> search_q;
    search_q.push(0);
    jump_record[0] = 0;
    search_record[0] = false;

    while (!search_q.empty())
    {
        int curr = search_q.front();
        search_q.pop();
        if (!search_record[curr])
        {
            for (int i = 1; i <= nums[curr]; i++)
            {
                search_q.push(curr + i);
                if (jump_record[curr + i] == 0)
                    jump_record[curr + i] = jump_record[curr] + 1;
                else
                    jump_record[curr + i] = std::min(jump_record[curr + i], jump_record[curr] + 1);
                if (curr + i == nums.size() - 1)
                    return jump_record[curr + i];
            }
            search_record[curr] = true;
        }
    }
    return -1;
}
